// Define your checkboxes for iteration
ShapeCheckBox[] checkBoxes = {
    cb_b1,  // corresponds to b1
    cb_b2,  // corresponds to b2
    cb_b3,  // corresponds to b3
    cb_recheckCPAvailability // corresponds to b4
};

// Define only the desired combinations
// Order of booleans: {b1, b2, b3, b4}
boolean[][] subselection = {
    {false, false, false, false}, // No behaviors
    {false, false, false, true},  // No behaviors, self checking
    {true,  false, false, false}, // Behavior 1
    {false, true,  false, false}, // Behavior 2
    {true,  false, true,  false}, // Behavior 1 and 3
    {true,  true,  true,  false}  // All behaviors
};

// Corresponding labels
String[] labels = {
    "No behaviors",
    "No behaviors, self checking",
    "Behavior 1",
    "Behavior 2",
    "Behavior 1 and 3",
    "All behaviors"
};

// Iterate only over these subselections
//for( v_EVsPerCP = 5; v_EVsPerCP <= 15; v_EVsPerCP++ ){
	for (int s = 0; s < subselection.length; s++) {
	    boolean[] scenario = subselection[s];
	    String label = labels[s];

	    // Apply the checkbox states
	    for (int i = 0; i < checkBoxes.length; i++) {
	        checkBoxes[i].setSelected(scenario[i], true);
	    }

	    // Log scenario info
	    System.out.println("Running scenario " + simulationCount + " : " + label);
	    traceln("B1=" + scenario[0] + ", B2=" + scenario[1] + ", B3=" + scenario[2] + ", B4=" + scenario[3]);

	    // Run simulation
	    for (int i = 0; i < iterations; i++) {
	        f_initializeModel();
	        f_endRun();
	        mains.get(0).f_cleanUp();
	    }
	    f_storeMCResults();
	    simulationCount++;
	}
//}


